    const ColorChanger = styled.div`
    background-color: #0fcc45;
    `;
  return (

<div class={s.container}>
  <div class={s.onlineIndicator}>
    <span class={s.blink}></span>
  </div>
  <h2 className={s.onlineText}>{text}</h2>
</div>


  )
}
